import React, { Component } from 'react';
import { Container, Jumbotron,Row,Col } from 'reactstrap';
import { Media } from 'reactstrap';

class Profile extends Component {
    constructor(props){
        super(props);
    }
  render()
   {
    return (
      <Jumbotron>
        <Media>
         
          <div class="media">
          <Container>
           <img class="align-self-center mr-3" src="holder.js/171x180" alt="Avatar"roundedCircle></img>
          </Container>
          <Container>
          <Row>
          <Col sm={{ size: 'auto', offset: 1 }}></Col>
           <Col sm={{ size: 12, offset: 1 }}>
            <div class="media-body">
             <h5 class="mt-12">Username</h5>
            </div>
           </Col>
          </Row>
          </Container>
          </div>
         
        </Media>
      </Jumbotron>
    );
   };
}

export default Profile
